    "2016-07-06T06:16:47.568142",nt"name": "gps-navigation-text-files-of-the-gps-navigation-logged-with-an-ashtech-g12-sensor-durin-28-2010",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS), in cooperation
    with the Connecticut Department of Environmental Protection and National Oceanic
    and Atmospheric Administration (NOAA), is producing detailed geologic maps of the
    coastal sea floor. Imagery, originally collected by NOAA for charting purposes,
    provides a fundamental framework for research and management activities along this
    part of Long Island Sound, shows the composition and terrain of the seabed, and
    provides information on sediment transport and benthic habitat. Interpretive data
    layers were derived from the multibeam echo-sounder data collected north of Duck
    Pond Point, New York. During April and May 2010, bottom photographs and surficial
    sediment data were acquired during 2 cruises as part of USGS ground-truth reconnaissance
    surveys of this area. For more information on the ground-truth surveys see <http://quashnet.er.usgs.gov/data/2010/10010/>
